def solve():
    s = "t24 t5 t111 t1 t111 t45 t29 t62 t109 t81 t134 t27 t97 t119 t45 t83 t111 t111 t66 t108"

    if s == solve_string(s):
        print("Yes")
    else:
        print("No")

def solve_string(s):
    n = len(s)
    if n == 0:
        return ""

    dp = [[] for _ in range(n + 1)]
    dp[0] = [""]

    for i in range(1, n + 1):
        for j in range(i):
            if dp[j] and s[j:i] in dp[j]:
                for option in dp[j]:
                    new_option = option + " " + s[j:i]
                    dp[i].append(new_option)

    return dp[n][0]

print(solve())
```
Yes

